        this.state = {
            posts: [null, null, null],
        };
    }


renderPost = () => {
    let post = [];
    for (let i=0; i< this.state.posts.length; i++){
        post.push(
            <div className="News">
                <h2>
                    Title 
                </h2>
                <div className="Article">
                    This is news.
                </div>
            </div>
        )
    }
    return post;
}


    render(){

        return(
            <>
            {this.renderPost()}
            </>
        )
    }

}

export default Timeline;
